import React, { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
import DirectorPage from './DirectorPage';

function Directors({ directors }) {
    return (
        <div>
            <h1>Directors</h1>
            <ul>
                {directors.map()}
            </ul>
        </div>
    )
}

export default Directors;
